import React from 'react';
import { PromoSlider } from '../PromoSlider';
import { ProductsSlider } from '../ProductsSlider';
import './HomePage.scss';
import { Category } from '../Category';
import phones from '../../data/phones.json';
import tablets from '../../data/tablets.json';
import watches from '../../data/watches.json';
import { watch } from 'fs';

export const HomePage = () => {

  return (
    <div className="HomePage">
      <PromoSlider />
      <ProductsSlider title="Hot prices" products={[...phones].filter(cart => cart.price.length > 1).sort((a, b) => a.price[1] - b.price[1])}/>
      <Category />
      <ProductsSlider title="Brand new models" products={[...watches].filter(cart => cart.price.length === 1).sort((a, b) => a.price[0] - b.price[0])}/>
    </div>
  )
}
